import React from "react";
//react router
import {
  BrowserRouter as Router,
  Route,
  Link
} from "react-router-dom";
// pages
import Index from "./pages/index";
import About from './pages/about';


//app file w/ react-router
function App() {
  return (
  <Router>
    <nav>
      <Link to='/'>Home</Link>
      <Link to='/about'>About</Link>
      <Link to='/explore'>Explore</Link>
      <Link to='/events'>Events</Link>

    </nav>
    <Route exact path='/'>
      <Index />
    </Route>

    <Route path='/about'>
      <h1>ABOUT</h1>
      <ul>
        <li>/about/mission</li>
        <li>/about/team</li>
      </ul>
      <About/>
    </Route>

    <Route path='/explore'>
      <h1>Explore</h1>
      <ul>
        <li>/explore/gallery</li>
        <li>/explore/contact</li>
        <li>/explore/social</li>
      </ul>
    </Route>
    <Route path='/events'>
      <h1>Events</h1>
    </Route>

  </Router>


  );
}

export default App;
